 <head>
  <meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
  <script type="text/JavaScript">
   var currentPageNO = 1;
   function getPageCount() {
     var all = document.querySelectorAll(".plot");
     return all.length;
   }
   function getPageHandle(pageNO) {
     var all = document.querySelectorAll(".plot");
     return all.item(pageNO - 1);
   }
   function onPage(pageNO) {
     if (pageNO != currentPageNO) {
       var currentPage = getPageHandle(currentPageNO);
       var newPage = getPageHandle(pageNO);
       newPage.style.display = "block";
       currentPage.style.display = "none";
       currentPageNO = pageNO;
       var pageInfo = document.getElementById("pageInfo");
       pageInfo.innerHTML = "Page " + pageNO;
     }
   }
   function onNextPage() {
     if (currentPageNO < getPageCount()) {
       onPage(currentPageNO + 1);
     }
   }
   function onPreviousPage() {
     if (currentPageNO > 1) {
       onPage(currentPageNO - 1);
     }
   }
   function onLastPage() {
     onPage(getPageCount());
   }
   function onLoad() {
     var all = document.querySelectorAll(".plot");
     if (all.length > 1) {
       var f = document.querySelector(".pageNav");
       f.style.display = "block";
       for (var k = 1; k < all.length; k++) {
         var h = all[k];
         h.style.display = "none";
       }
     }
   }
  </script>
  <style>
    body { margin: 0; }
    .pageNav { margin-left: 1in; padding: 12px 0 0 0; }
  </style>
